INSERT INTO `dostums_bio_notice` (`id`, `name`, `date_of_birth`, `date_of_dead`, `photo`, `detail`, `date`, `status`) VALUES
(1, 'Mahatma Gandhi', 'October 2, 1869, Porbandar, India', '30 January 1948', 'photo_upload__1479469319_1479469319.jpg', 'Mohandas Karamchand Gandhi (/????ndi, ??æn-/;[2] Hindustani: [?mo???nd?a?s ?k?r?mt??nd? ??a?nd??i] ( listen); 2 October 1869 – 30 January 1948) was the preeminent leader of the Indian independence movement in British-ruled India. Employing nonviolent civil disobedience, Gandhi led India to independence and inspired movements for civil rights and freedom across the world. The honorific Mahatma (Sanskrit: \"high-souled\", \"venerable\")[3]—applied to him first in 1914 in South Africa,[4]—is now used worldwide. He is also called Bapu (Gujarati: endearment for \"father\",[5] \"papa\"[5][6]) in India. In common parlance in India he is often called Gandhiji. He is unofficially called the Father of the Nation.[7][8]\r\n\r\nBorn and raised in a Hindu merchant caste family in coastal Gujarat, western India, and trained in law at the Inner Temple, London, Gandhi first employed nonviolent civil disobedience as an expatriate lawyer in South Africa, in the resident Indian community\'s struggle for civil rights. After his return to India in 1915, he set about organising peasants, farmers, and urban labourers to protest against excessive land-tax and discrimination. Assuming leadership of the Indian National Congress in 1921, Gandhi led nationwide campaigns for easing poverty, expanding women\'s rights, building religious and ethnic amity, ending untouchability, but above all for achieving Swaraj or self-rule.\r\n\r\nGandhi famously led Indians in challenging the British-imposed salt tax with the 400 km (250 mi) Dandi Salt March in 1930, and later in calling for the British to Quit India in 1942. He was imprisoned for many years, upon many occasions, in both South Africa and India. Gandhi attempted to practise nonviolence and truth in all situations, and advocated that others do the same. He lived modestly in a self-sufficient residential community and wore the traditional Indian dhoti and shawl, woven with yarn hand-spun on a charkha. He ate simple vegetarian food, and also undertook long fasts as a means of both self-purification and social protest.\r\n\r\nGandhi\'s vision of an independent India based on religious pluralism, however, was challenged in the early 1940s by a new Muslim nationalism which was demanding a separate Muslim homeland carved out of India.[9] Eventually, in August 1947, Britain granted independence, but the British Indian Empire[9] was partitioned into two dominions, a Hindu-majority India and Muslim-majority Pakistan.[10] As many displaced Hindus, Muslims, and Sikhs made their way to their new lands, religious violence broke out, especially in the Punjab and Bengal. Eschewing the official celebration of independence in Delhi, Gandhi visited the affected areas, attempting to provide solace. In the months following, he undertook several fasts unto death to promote religious harmony. The last of these, undertaken on 12 January 1948 when he was 78,[11] also had the indirect goal of pressuring India to pay out some cash assets owed to Pakistan.[11] Some Indians thought Gandhi was too accommodating.[11][12] Nathuram Godse, a Hindu nationalist, assassinated Gandhi on 30 January 1948 by firing three bullets into his chest at point-blank range.[12]\r\n\r\nHis birthday, 2 October, is commemorated as Gandhi Jayanti, a national holiday, and world-wide as the International Day of Nonviolence.', '2016-11-18', 1),
(2, 'Sheikh Mujibur Rahman', 'March 17, 1920', 'August 15, 1975', 'photo_upload__1479469502_1479469502.jpg', 'Sheikh Mujibur Rahman (Bengali: ??? ??????? ?????; Bengali pronunciation: [Shekh Mujibur Rôhman]) (17 March 1920 – 15 August 1975) was the founding leader of Bangladesh. He served twice as the country\'s President and was its strongman premier between 1972 and 1975. Rahman was the leader of the Awami League. He is popularly known as the Bangabandhu (Friend of Bengal). He is credited as the central figure in Bangladesh\'s liberation movement and has been compared with many populist founding fathers of the 20th century. His daughter Sheikh Hasina Wajed is the current Prime Minister of Bangladesh.\r\n\r\nAn advocate of socialism, Rahman rose with the ranks of the Awami League and East Pakistani politics as a charismatic and forceful orator. He became popular for his opposition to the ethnic and institutional discrimination of Bengalis in Pakistan, who compromised the majority of the state\'s population. At the heightening of sectional tensions, he outlined a 6-point autonomy plan and was jailed by the regime of Field Marshal Ayub Khan for treason. Rahman led the Awami League to win the first democratic election of Pakistan in 1970. Despite gaining a majority, the League was not invited by the ruling military junta to form a government. As civil disobedience erupted across East Pakistan, Rahman announced the Bangladeshi struggle for independence during a landmark speech on 7 March 1971. On 26 March 1971, the Pakistan Army responded to the mass protests with Operation Searchlight, in which Prime Minister-elect Rahman was arrested and flown to solitary confinement in West Pakistan,[1] while Bengali civilians, students, intellectuals, politicians and military defectors were murdered as part of the 1971 Bangladesh genocide. After Bangladesh\'s liberation, Rahman was released from Pakistani custody and returned to Dhaka in January 1972.\r\n\r\nRahman became the Prime Minister of Bangladesh under a parliamentary system adopted by the new country. His government enacted a constitution proclaiming socialism and secular democracy. The Awami League won a huge mandate in the country\'s first general election in 1973. However, Rahman faced challenges of rampant unemployment, poverty and corruption. A famine took place in 1974. The government was criticized for denying constitutional recognition to indigenous minorities and human rights violations by its security forces, notably the National Defense Force paramilitia. Amid rising political agitation, Rahman initiated one party socialist rule in January 1975. Six months later, he and most of his family were assassinated by renegade army officers during a coup. A martial law government was subsequently established.\r\n\r\nIn a 2004 BBC Bengali opinion poll, Rahman was voted as the \"Greatest Bengali of All Time\".', '2016-11-18', 1);
